  accommodationFacility?: Prisma.AccommodationFacilityOmit
  accommodationAmenity?: Prisma.AccommodationAmenityOmit
  accommodationManager?: Prisma.AccommodationManagerOmit
  contract?: Prisma.ContractOmit
  payment?: Prisma.PaymentOmit
